#include <iostream>
#include <map>

using namespace std;

char findTheDifference(string s, string t) {
    if (s.size() == 0) {
        return t[0];
    }

    map<char, int> s_chars;
    char return_char;

    for (int i=0; i<s.size(); i++) {
        if (s_chars.find(s[i]) == s_chars.end()) {
            s_chars[s[i]] = 1;
            continue;
        }

        s_chars[s[i]]++;
    }

    for (int i=0; i<t.size(); i++) {
        if (s_chars.find(t[i]) == s_chars.end() || s_chars[t[i]] == 0) {
            return_char = t[i];
            break;
        }

        s_chars[t[i]]--;
    }

    return return_char;
}

int main() {
    string s = "";
    string t = "";

    cout << findTheDifference(s, t) << "\n";

    return 0;
}